-- Наполнение БД с помощью сайта Fulldb

USE metal_archives;



UPDATE genres SET genre = CONCAT(UCASE(LEFT(genre, 1)), SUBSTRING(genre, 2));


UPDATE lyrical_themes SET lyrical_theme = CONCAT(UCASE(LEFT(lyrical_theme, 1)), SUBSTRING(lyrical_theme, 2));


UPDATE styles SET style = CONCAT(UCASE(LEFT(style, 1)), SUBSTRING(style, 2));



UPDATE labels SET founding_date = 'N/A' WHERE founding_date = 0000;
UPDATE labels SET adress = 'N/A' WHERE adress = '';
UPDATE labels SET adress = 'N/A' WHERE adress = '';
UPDATE labels SET email = 'N/A' WHERE email = '';
UPDATE labels SET phone = 'N/A' WHERE phone = '';
UPDATE labels SET website_link = CONCAT('https://www.', LOWER(REPLACE(label_name, ' ', '')), '.com') WHERE id > 1;
UPDATE labels SET logo_image_link = CONCAT('https://www.metal-archives.com/images/labels/', id, '.jpg') WHERE id > 1;
UPDATE labels SET label_name = CONCAT(UCASE(LEFT(label_name, 1)), SUBSTRING(label_name, 2)) WHERE id > 1;



UPDATE bands SET country_id = 1 WHERE location_early_id = 1;
UPDATE bands SET country_id = (
SELECT country_id
FROM locations
WHERE location_early_id = locations.id
);
UPDATE bands SET formed_in = 'N/A' WHERE formed_in = 0000;
UPDATE bands SET formed_in = years_active WHERE formed_in > years_active;
UPDATE bands SET years_active = CONCAT(years_active, '-present') WHERE status_band_id = 1;
UPDATE bands SET current_label_id = NULL WHERE status_band_id IN(5,6);
UPDATE bands SET last_label_id = NULL WHERE status_band_id IN(1,2,3,4);
UPDATE bands SET band_image_link = NULL WHERE band_image_link = '';
UPDATE bands SET logo_image_link = NULL WHERE logo_image_link = '';
UPDATE bands SET band_image_link = CONCAT('https://www.metal-archives.com/images/bands/', id, '_photo.jpg') WHERE band_image_link IS NOT NULL;
UPDATE bands SET logo_image_link = CONCAT('https://www.metal-archives.com/images/bands/', id, '_logo.jpg') WHERE logo_image_link IS NOT NULL;

